              <p class="justify-content">
              Yeshwanth Yejjavarapu feels – “I think there is something in me at a young age
              that was not worried about success, but was worried about becoming a better
              actor” – so is the feeling any actor before he or she attains stardom..
              This youngster who is a rising star on Telugu screen hails from
              Rajamahendravaram of Andhra Pradesh and has played the lead role in Oye
              Idiot. It was Yeshwanth’s childhood dream to see himself in larger than life
              roles. By the grace of god he could identify his talent and could focus on his
              goal to be an actor at a very early stages of his life. Yeshwanth belives that
              there is nothing like action, but one has to live the role he has to enact. What a
              perfect idea of acting? Kudos to his school of thought.
              Often stars are not made, they are born, so is the story of Yeshwanth.
              </p>
             
