The
movement he realized where he belongs, he stated to polish his skills of acting.
Getting into film industry without much of filmy background is not a cakewalk.
And the story is no different for young talented Yeshwanth. Though he was
offered various roles on small screen, he never wanted to limit himself and his
talent to the role of drawing room buddy. Yeshwanth faced many rejections and
often got dropped from the roles for which he was picked up.. Nothing deterred
him from the objective of becoming an actor.
Remember, even the legendary Amitab Bacchan too faced rejections, which
ultimately lead him to the unlimited collection of awards and fame. Yeshwanth
never got disappointed with various films from which he was either dropped or
those which never made up to the silver screen or the OTT. He played a very
short role in “Meelo Evaru Koteswarulu” where he got his first break. After he
got an oppurtunity to play a short role in the movie Raja the great. Being a new
entrant – he was willing to accept any challenging role that would satisfy the
actor in him. Yeshwanth knew pretty well that a hefty remuneration is a far cry
at this stage, but was confident of reaching it soon. It is the director Teja of "Nene Raju Nene Mantri" fame, who finally recognised and encouraged this young aspiring hero,
who was feeling low and exhausted after hundreds of attempts in vein.Finally, A debut director Venkat could pick up his talent and choosed yeshwanth
as perfect fit for the hero role in “Oye Idiot”. But that wasn’t that easy, it
demanded Yeshwanth to transform his body to fit the lead role, which he did
taking many other leading heros who transform themselves into the roles they
are offered - as an inspirational model, and he did it with dedication and
perfection.
